import React from 'react'
import "./Video.css";

function Video() {
    return (
        <div className="video">
            <h1>Hello From Video</h1>
            <video
                className="videoPlayer"
                loop
                autoPlay
                src="client\public\mp4.mp4">
            </video>
        </div>
    )
}

export default Video;
